import React from 'react'
import Axios from 'axios'
import { Form, DatePicker, TimePicker, Button, Card } from 'antd'
import 'antd/dist/antd.css'
const { MonthPicker, RangePicker } = DatePicker

const baseURL =
  process.env.NODE_ENV === 'production' ? 'here should be your production endpoint' : 'http://localhost:3000'

class Pedido extends React.Component {
  state = {
    places: {}, 
    unplan
  }

  componentDidMount() {
    Axios.get(`${baseURL}/places/${this.props.match.params.id}`)
      .then(({ data }) => {
        this.setState({
          unplan: data.plan
        })
      })
      .catch(err => {
        console.log(err)
      })
  }

  render() {
    const { unplan } = this.state
    if (!unplan) return <p>Loading data...</p>
    return (
      <div>
        <Form.Item label="DatePicker">
          <DatePicker />
        </Form.Item>
        <Form.Item label="TimePicker">
          <TimePicker />
        </Form.Item>
      </div>
    )
  }
}

export default Pedido
